t here ????\n}\n</pre><p>I am getting blank in the console.</p><p>Is there any way to get the span text printed in the console after the first DIV is dragged into the second div ?</p><p>Here is the code for the full HTML Page.</p><pre class=\"ql-syntax\" spellcheck=\"false\">&lt;html&gt;\n&lt;head&gt;\n    &lt;script&gt;\n      function allowDrop(ev) {\n        ev.preventDefault();\n      }\n      \n      function drop(ev) {\n          ev.preventDefault();                     \n          var data = ev.dataTransfer.getData(\"text\");\n          console.log(data); // How can I get the SPAN text here ????\n      }\n    &lt;/script&gt;\n&lt;/head&gt;\n&lt;body&gt;\n    &lt;div draggable=\"true\" style=\"border:5px solid blue; height:30px; width:150px;\"&gt;\n        &lt;span&gt;Value123&lt;/span&gt;\n    &lt;/div&gt;\n    &lt;br/&gt;&lt;br/&gt;\n    &lt;div id=\"dropzone\" ondrop=\"drop(event)\" ondragover=\"allowDrop(event)\" \n    style=\"border: 2px solid blue; height:200px; width:400px\"&gt;        \n&lt;/body&gt;    \na&lt;/html&gt;\n</pre><p><br></p></body></html>','ff87a0a6-19d4-4293-9d56-1e85ba466b49',6,'2023-06-14 10:24:13','2023-06-15 07:22:33'),('7fad976f-d915-4196-ab11-6e4aa2ef4735','How to select an item which renders a drop-down list of items that match a search','<html><head></head><body><p>-1</p><p><br></p><p><br></p><p><br></p><p>I\'m attempting to select an item which renders a drop-down list of items that match a search.</p><p>I select the correct item once the drop-down list has been opened. The&nbsp;<code style=\"color: var(--black-800); background-color: var(--black-075);\">id</code>&nbsp;values changes so they cannot be used.</p><p>This is the script in Cypress:</p><pre class=\"ql-syntax\" spellcheck=\"false\">cy.get(\'input[placeholder=\"Search Something\"]\').type(\'Your search query\').type(\'{enter}\');\ncy.contains(\'div span\', \'XXXXX XXX\').click();\n\nor \n\ncy.get(\'div[role=\"listbox\"]\')\n  .contains(\'span\', \'XXX XXX\')\n  .should(\'exist\')\n  .click();\n</pre><p>Below is the inspection from the page:</p><pre class=\"ql-syntax\" spellcheck=\"false\">&lt;div \n  class=\"w-full\" \n  id=\"headlessui-combobox-button-137\" \n  tabindex=\"-1\" \n  aria-haspopup=\"listbox\" \n  aria-expanded=\"true\" \n  data-headlessui-state=\"open\" \n  aria-controls=\"headlessui-combobox-options-139\"\n&gt;\n    &lt;input \n      placeholder=\"Search Subscribers\"  \n      class=\"w-full inputFocus px-4 rounded-3xl text-ever-green  font-beatrice font-normal transition-colors focus:border-cornflower-blue focus:outline-none outline-none placeholder:text-slate-gray h-smButtonHeight text-sm border-2 border-duck-egg-blue\"  \n      id=\"headlessui-combobox-input-138\"  \n      role=\"combobox\"  \n      type=\"text\"  \n      aria-expanded=\"true\"  \n      aria-autocomplete=\"list\"  \n      data-headlessui-state=\"open\"  \n      value=\"Prod\"  \n      aria-controls=\"headlessui-combobox-options-139\"  \n      aria-activedescendant=\"headlessui-combobox-option-156\"\n    &gt;\n&lt;/div&gt;\n</pre><p><br></p></body></html>','ff87a0a6-19d4-4293-9d56-1e85ba466b49',0,'2023-06-14 08:15:48',NULL),('9db6b219-24a1-4cd2-aa6d-a5e094247cc0','đây là bài thứ 2','<p><img src=\"data:image/png;base64,\"></p><p><br></p><p>abc xzyasd</p>','65e6abc0-b998-47f0-8afc-a4e26219d4d7',30,'2023-06-07 03:17:41','2023-06-13 04:03:57'),('ae08595c-b9ed-4f45-a776-f790b899871e','What is more performant? mask-image: url(\"data:image/svg+xml,base64,...\") or url(\"data:image/svg+xml,utf8,<svg...\")','<html><head></head><body><p>What is more performant for the browser? Using&nbsp;<code style=\"color: var(--black-800); background-color: var(--black-075);\">base64</code>&nbsp;or&nbsp;<code style=\"color: var(--black-800); background-color: var(--black-075);\">utf8</code>&nbsp;when using&nbsp;<code style=\"color: var(--black-800); background-color: var(--black-075);\">mask-image</code>&nbsp;in css:</p><pre class=\"ql-syntax\" spellcheck=\"false\">mask-image: url(\"data:image/svg+xml,base64,PHN2...\")&gt; \n</pre><p>or</p><pre class=\"ql-syntax\" spellcheck=\"false\">mask-image: url(\"data:image/svg+xml,utf8,&lt;svg...\")&gt;\n</pre><p>?</p></body></html>','ff87a0a6-19d4-4293-9d56-1e85ba466b49',0,'2023-06-14 08:21:01',NULL),('c22cea71-67ab-4014-a058-b6e520d5afbe','sâf','<html><head></head><body><p>âsf</p><p class=\"ql-align-center\"><img src=\"https://storage.googleapis.com/md03-3efbf.appspot.com/1686814076448-0.gif\"></p></body></html>','ff87a0a6-19d4-4293-9d56-1e85ba466b49',2,'2023-06-15 07:27:58','2023-06-15 07:28:23'),('d8d8c90f-abd9-45d9-bfbe-f36f97eb5cc6','Getting segmentation fault while using call by reference to return multiple values in recursive function','<html><head></head><body><p>The question is to find the maximum and minimum element in an array and return their difference. I referred to the editorial of the problem on GeeksforGeeks. I used the tournament method, in which we partition any array having more than two elements into 2 parts, and find the maximum and minimum of those two arrays, and then return the answer after comparing these final values. The official solution listed&nbsp;<a href=\"https://www.geeksforgeeks.org/maximum-and-minimum-in-an-array/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--theme-link-color);\">here</a>&nbsp;, uses a struct pair. I wanted to do it using call by reference values.</p><p>Initially I tried to return 2 values with the function like:</p><p><code style=\"color: var(--black-800); background-color: var(--black-075);\">int r1,r2= Sample(a,high,low)</code></p><p>That is wrong(as we can return only 1 value from the function) So I tried passing by reference like this:</p><pre class=\"ql-syntax\" spellcheck=\"false\">void halfarrsol(int arr[], int low, int high, int &amp;mi, int &amp;ma){\nint mid, min,max;\nif(low==high){\n    mi=ma=arr[low];\n}\nif(high==low+1){\n    mi=arr[low], ma=arr[high];\n    if(arr[low]&gt;arr[high]){\n        mi=arr[high];\n        ma=arr[low];\n    }\n}\nelse {\n    mid=(low+high)/2;\n    halfarrsol(arr, low,mid,mi,ma);\n    int minl=mi, maxl=ma;\n    halfarrsol(arr, mid+1,high,mi,ma);\n    int minr=mi, maxr=ma, fin=minl;\n    if(minl&gt;minr){\n        fin= minr;\n    }\n    int fax=maxl;\n    if(maxl&lt;maxr){\n        fax=maxr;\n    }\n    mi= fin;\n    ma=fax;\n}\n}\n</pre><p>The idea is that when I call the function, the final value of min and max (mi and ma) will be available. One obvious error that I think might be messing things up is the</p><pre class=\"ql-syntax\" spellcheck=\"false\">halfarrsol(arr, low,mid,mi,ma);\n      int minl=mi, maxl=ma;\n</pre><p>What I\'m trying to here is store the obtained mi and ma vales(for this half array) in \'minl\' and \'maxl\' variables. Is this valid? The overall code gives a segmentation error, and timeout: the monitored command dumped core error. I\'m not sure what exactly I\'m messing up, or if this approach is completely wrong. I wanted to be able to solve this question without using a Struct Pair, and without using another class and creating an object. There are also solutions like using a Tuple to store min and max values, but I considered them to be more applicable for when we have many return values, as here I am using 2 values only. Is there any way to solve this problem recursively using call by reference?</p><p>If required you can view the driver code&nbsp;<a href=\"https://onlinegdb.com/-3pMGbixH\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--theme-link-color);\">here</a></p></body></html>','ff87a0a6-19d4-4293-9d56-1e85ba466b49',14,'2023-06-14 08:24:04','2023-06-15 05:47:31'),('ee5a0e95-9bfc-4841-953e-da6a3a3f3893','bài test thử FireBase','<html><head></head><body><p>đâs</p><p>đá</p><p>dá</p><p><img src=\"https://storage.googleapis.com/md03-3efbf.appspot.com/1686562052733-0.png\"></p><p><br></p><p><img src=\"https://storage.googleapis.com/md03-3efbf.appspot.com/1686562052738-1.gif\"></p></body></html>','f3ed720f-85da-4dc0-ad00-aeae7aaa8fda',26,'2023-06-12 09:27:34','2023-06-14 08:17:53');
